(()=>{"use strict";document.addEventListener("DOMContentLoaded",(function(){var t=document.getElementById("history-list");browser.storage.local.get(["categorizedHistory"]).then((function(e){var n=e.categorizedHistory||[];0===n.length?t.innerHTML="<li>No history available.</li>":n.forEach((function(e){var n=document.createElement("li");n.innerHTML='<a href="'.concat(e.url,'" target="_blank">').concat(e.title,"</a> - <em>").concat(e.category,"</em>"),t.appendChild(n)}))})).catch((function(t){return console.error("Error fetching history:",t)}))}))})();